import SidBar from "./componant/SidBar"
import  './componant/App.css';
import { Route, Routes } from "react-router-dom";
import Home from "./componant/Home";
import Prodacts from "./componant/Prodacts";
import Cateogiers from "./componant/Cateogiers";
import NavBar from "./componant/NavBar";
import AddProdact from "./componant/AddProdact";
import ProdactDetetils from "./componant/ViewProdact";
import Edit from "./componant/EditProdact";
import AddCateogiers from "./componant/AddCateogiers";
import View2 from "./componant/View";

function App(){
return(
<div className="App">
<NavBar/>
<div className="row">
<div className="col-2 sidebar">
<SidBar/>
</div>
<div className="col-9">
<Routes>
<Route path="/" element={<Home/>}></Route>
<Route path="Prodacts" element={<Prodacts/>}></Route>
<Route path="Cateogiers" element={<Cateogiers/>}></Route>
<Route path="Prodacts/Add" element={<AddProdact/>}></Route>
<Route path="Cateogiers/Add1" element={<AddCateogiers/>}></Route>
<Route path="Cateogiers/:Id" element={<View2/>}></Route>
<Route path="Prodacts/:Id" element={<ProdactDetetils/>}></Route>
<Route path="Prodacts/Edit/:Id" element={<Edit/>}></Route>
<Route path="Cateogiers/EditCategres/:Id" element={<Edit/>}></Route>


</Routes>
</div>
</div>
</div>
)
}

export default App
